import React from 'react';
import { apiKey, PLAYLISTS, YOUTUBEURL } from './apis';
import { useState } from 'react';
import ids from '../channelId/ids';

const playlists = async ({number}) => {
    const json = await (
        await fetch(
            `${YOUTUBEURL}${PLAYLISTS}?key=${apiKey}&channelId=${ids.MavelKorea}&maxResults=50&part=snippet,contentDetatils`
        )
    ).json();
    return json.items[number].id;
}


export {playlists};
